import React, {Component} from "react";
import "../styles/user-form.css";

class UserProfileComponent extends Component { 

  render() {
    function UserDataElement(name, email) {
      console.log(name, email);
      return (
        <div>
          <div>User Name: {props.name}</div>
          <div>User Email: {props.email}</div>
        </div>
      )
    }
    function DefaultElement() {
      return (
        <div>User Data Not Found. Please Submit use info in the form above.</div>
      )
    }
    const AssessDisplayElement = () => {
      return this.props.displayInfo?
        <UserDataElement 
          name={this.props.name}
          email={this.props.email}/>
        : <DefaultElement/>;
    }

    return (<AssessDisplayElement/>)
  }
}

export default UserProfileComponent;
